return items.map(item => {
  const name = item.json.name || '';
  const rawNumber = item.json.id || '';

  // Remove tudo que não for número
  const digits = rawNumber.replace(/\D/g, '');

  // Pega os últimos 10 dígitos (DDD + número)
  const last10Digits = digits.slice(-10);

  // Validação: precisa ter exatamente 10 dígitos
  if (last10Digits.length !== 10) {
    return {
      json: {
        name,
        number: 'Número inválido'
      }
    };
  }

  // Monta o número final com DDI + DDD + número
  const formatted = '55' + last10Digits;

  return {
    json: {
      name,
      number: formatted
    }
  };
});
